INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, "2030/01/01 14:59:59", 64, 1, 1, 2.33, 2, -363.0, "2025/01/31 12:00:00", 190805, 1000007, 7, "カリン");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, "2030/01/01 14:59:59", 61, 7, 10201, 5.18, 3, -285.0, "2025/01/31 12:00:00", 133701, 1020101, 101, "ラビリスタ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, "2030/01/01 14:59:59", 61, 2, 10201, 8.77, 1, -285.0, "2025/01/31 12:00:00", 133901, 1020102, 201, "クリスティーナ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, "2030/01/01 14:59:59", 61, 1, 10201, 15.5, 6, -285.0, "2025/01/31 12:00:00", 133801, 1020103, 301, "ネネカ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, "2030/01/01 14:59:59", 61, 5, 10202, 9.061, 2, -285.0, "2025/02/28 12:00:00", 134301, 1020201, 101, "ランファ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, "2030/01/01 14:59:59", 61, 2, 10202, 7.699, 1, -285.0, "2025/02/28 12:00:00", 134401, 1020202, 201, "チカ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, "2030/01/01 14:59:59", 61, 2, 10203, 8.595, 1, -285.0, "2025/03/31 12:00:00", 134601, 1020301, 101, "アオイ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, "2030/01/01 14:59:59", 61, 2, 10203, 7.758, 1, -285.0, "2025/03/31 12:00:00", 134501, 1020302, 201, "クローチェ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, "2030/01/01 14:59:59", 61, 6, 10204, 7.0, 2, -285.0, "2025/04/30 12:00:00", 132302, 1020401, 101, "ルイズマリー");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, "2030/01/01 14:59:59", 61, 2, 10204, 7.904, 1, -285.0, "2025/04/30 12:00:00", 132402, 1020402, 201, "イロハ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, "2030/01/01 14:59:59", 61, 2, 10204, 8.487, 4, -285.0, "2025/04/30 12:00:00", 132502, 1020403, 301, "ソノ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, "2030/01/01 14:59:59", 61, 2, 10205, 8.763, 1, -285.0, "2025/05/31 12:00:00", 134901, 1020502, 101, "カノン");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, "2030/01/01 14:59:59", 61, 3, 10205, 6.417, 1, -285.0, "2025/05/31 12:00:00", 134801, 1020503, 201, "ツムギ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0, "2030/01/01 14:59:59", 61, 7, 10206, 10.335, 3, -285.0, "2025/06/30 12:00:00", 135001, 1020601, 101, "エリス");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0, "2030/01/01 14:59:59", 61, 4, 10206, 6.281, 2, -285.0, "2025/06/30 12:00:00", 135101, 1020602, 201, "シェフィ");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0, "2030/01/01 14:59:59", 61, 2, 10206, 12.244, 1, -285.0, "2025/06/30 12:00:00", 135201, 1020603, 301, "プレシア");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 0.0, "2030/01/01 14:59:59", 61, 8, 10207, 6.339, 2, -285.0, "2025/07/31 12:00:00", 135301, 1020701, 101, "クリア");
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 0.0, "2030/01/01 14:59:59", 61, 9, 10207, 8.184, 7, -285.0, "2025/07/31 12:00:00", 135401, 1020702, 201, "アネモネ");
